import React from 'react';
import { HiBell } from 'react-icons/hi'

const Header = () => {
  return (
    <div className='absolute w-[75vw] h-[12vh] left-[15vw] border-b'>
      <div className='flex flex-row items-center p-0 gap-[28.02px] absolute'>
        <HiBell />
      </div>
    </div>
  )
}

export default Header
